The '''Wardens of Annúminas''' were a group of [[Dunedain]] in ''[[The Lord of the Rings Online]]'' that protected the ancient city of [[Annúminas]]. They fought the forces of [[Angmar]], tomb raiders, Gerheryg, Kirgrim and even the forces of nature. 

[[Tinnudir]], the city they called home was located on an island in the middle of [[Lake Evendim]]. Annúminas was too dangerous because of the constant company of [[Orcs]].
